INSERT INTO `code_table_template` VALUES (1,1715638274,'utils','工具类库',1,'import java.text.SimpleDateFormat\nimport java.util.regex.Matcher;\nimport java.util.regex.Pattern;\n\ndef main(name) {\n  // println calcFields(name)\n  \"fields: \" + calcTable(name)\n}\n\ndef tint(i) {\n  \"int: \" + i\n}\n\n//转换表\ndef calcTable(table) {\n  def fields = calcFields(table)\n  def t = [\n    name: table.name,\n    title: table.title,\n    comment: table.comment,\n    upperCamelCase: upperCamelCase(table.name),\n    camelCase: camelCase(table.name),\n//    frontName: upperWords(getExtendData(table.comment, \'frontName\', table.name)),  //前端显示名， 主要详情页\n    approval: getExtendData(table.comment, \'approval\', null), //审批操作\n    frontHome: getExtendData(table.comment, \'frontHome\', null), //首页类型\n    option: getExtendData(table.comment, \'option\', null), //选项接口\n    tree: getExtendData(table.comment, \'tree\', null), //tree接口 id~title~parent_id\n    apis: getApis(getExtendData(table.comment, \'apis\', null)), //获取模型对应的api信息\n    fields: fields,\n  ]\n}\n\n//字段转换\ndef calcFields(vo) {\n  def columns = vo.columnList\n  def fields = []\n\n  columns.each{col->\n    fields += [[\n      name: col.name,\n      dataType: col.dataType,\n      isPk: col.isPk,\n      title: col.title ? col.title : col.name,\n      isNotNull: col.isNotNull,\n      isUnique: col.isUnique,\n      isAutoIncrement: col.isAutoIncrement,\n      isZeroFill: col.isZeroFill,\n      defaultValue: col.defaultValue,\n      length: col.length,\n      scale: col.scale,\n      comment: col.comment,\n\n      //获取解析填充数据\n      upperCamelCase: upperCamelCase(col.name),\n      camelCase: camelCase(col.name),\n      frontName: upperWords(getExtendData(col.comment, \'frontName\', col.name)), //前段展示名\n      frontType: getFrontType(col.dataType, col.getComment()), //前端展示类型\n      frontMax: col.length == null ? null : col.length + col.scale, //前段编辑框最大长度\n      frontStep: 1, //如果是number类型 步进长度\n      isFilter: getExtendData(col.getComment(), \'isFilter\', \'false\'), //字段是否再列表页过滤器中\n      isEnum: getExtendData(col.getComment(), \'isEnum\', \'false\'), //字段是否为数据字典枚举\n      isApproval: getExtendData(col.getComment(), \'isApproval\', \'false\'), //审核字段\n      linkDetails: getExtendData(col.getComment(), \'linkDetails\', \'false\'), //链接详情页\n      dict: getExtendData(col.getComment(), \'dict\', \'\'), //标记字典数据组键名\n      editReadOnly: getExtendData(col.getComment(), \'editReadOnly\', \'false\'), //编辑只读\n      options: getOptions(col.comment), //如果字段为选项字段， 则为选项\n      foreignTableName: getForeignTable(col.comment), //外链表名\n      foreignTableUpperCamelCaseName: upperCamelCase(getForeignTable(col.comment)), //外链表大驼峰名\n      foreignTableLowerCamelCaseName: camelCase(getForeignTable(col.comment)), //外链表大驼峰名\n\n      //java相关选项\n      javaType: getJavaType(col.dataType, col.getComment()), //对应的java类型\n    ]]\n  }\n  fields\n}\n\n// 大驼峰命名\ndef upperCamelCase(str) {\n  if(str == \"\") {\n    return str\n  }\n    if(str  == null) {\n        return null;\n    }\n  def name = camelCase(str)\n  name.substring(0, 1).toUpperCase() + name.substring(1);\n}\n\n// 小驼峰命名\ndef camelCase(str) {\n    if(str  == null) {\n        return null;\n    }\n    final StringBuffer sb = new StringBuffer();\n    Pattern p = Pattern.compile(\"_(\\\\w)\");\n    Matcher m = p.matcher(str);\n    while (m.find()){\n        m.appendReplacement(sb,m.group(1).toUpperCase());\n    }\n    m.appendTail(sb);\n    sb.toString()\n}\n\n//下划线名字转大写首字母单词串\ndef upperWords(str) {\n      if(str  == null) {\n        return null;\n    }\n    final StringBuffer sb = new StringBuffer();\n    Pattern p = Pattern.compile(\"_(\\\\w)\");\n    Matcher m = p.matcher(str);\n    while (m.find()){\n        m.appendReplacement(sb,\" \" + m.group(1).toUpperCase());\n    }\n    m.appendTail(sb);\n    def name = sb.toString()\n    name.substring(0, 1).toUpperCase() + name.substring(1);\n}\n\n/**\n * 获取前端类型\n *\n * @param dbType\n * @param comment\n * @return\n */\ndef getFrontType(dbType, comment) {\n    def frontType = getExtendData(comment, \'frontType\', null);\n    if(frontType) {\n        return frontType;\n    }\n    switch (dbType) {\n        case \"int\":\n        case \"tinyint\":\n        case \"smallint\":\n        case \"mediumint\":\n        case \"bigint\":\n        case \"float\":\n        case \"double\":\n        case \"decimal\":\n            frontType = \"number\"\n            break;\n        default:\n            frontType = \"text\";\n            break;\n    }\n    return frontType;\n}\n\n/**\n * 获取外链表\n *\n * @param comment\n * @return\n */\ndef getForeignTable(comment) {\n    def foreign = getExtendData(comment, \'foreign\', null)\n    if(foreign) {\n        String[] parts = foreign.split(\"~\")\n        if(parts && parts.length>=1) {\n            def fid = parts[0]\n            String[] tableParts = fid.split(\"\\\\.\")\n            if(tableParts.length>0) {\n                return tableParts[0]\n            }\n        }\n    }\n    return null;\n}\n\n/**\n * 获取关联表大驼峰名\n */\ndef getForeignTableUpperCamelCase(comment) {\n    def capita = getForeignTable(comment)\n    if(capita) {\n        return upperCamelCase(capita)\n    }\n    return null;\n}\n\n/**\n * 获取前端校验最小值\n */\ndef getFrontMin(it) {\n    def min = 0\n    def minStr = getExtendData(it.comment,\"min\", null)\n    if(minStr != null) {\n        return Integer.valueOf(minStr)\n    }\n\n    //检查表单类型\n    def frontType = getExtendData(it.comment, \'frontType\', \'text\')\n    if(frontType != \'text\') {\n        return null;\n    }\n\n    if(it.dbUnsigned) {\n        //无符号\n        switch (it.dbType) {\n            case \"tinyint\":\n            case \"smallint\":\n            case \"mediumint\":\n            case \"int\":\n            case \"bigint\":\n                min = 0;\n                break;\n            default:\n//                min = it.length;\n                break;\n        }\n    } else {\n        switch (it.dbType) {\n            case \"tinyint\":\n                min = -128\n                break;\n            case \"smallint\":\n                min = -32768;\n                break;\n            case \"mediumint\":\n                min = 	-8388608;\n                break;\n            case \"int\":\n                min = -2147483648;\n                break;\n            case \"bigint\":\n                min = -9007199254740991;  //该值为Js最大值\n                break;\n            default:\n//                min = it.length;\n                break;\n        }\n    }\n    return min;\n}\n\n/**\n * 获取前端校验最小值\n */\ndef getFrontMax(it) {\n    def max = it.length\n    //dbUnsigned\n    def maxStr = getExtendData(it.comment,\"max\", null)\n    if(maxStr != null) {\n        //如果指定直接使用指定值\n        return Integer.valueOf(maxStr)\n    }\n\n    //检查表单类型\n    def frontType = getExtendData(it.comment, \'frontType\', \'text\')\n    if(frontType != \'text\') {\n        return null;\n    }\n\n    if(it.dbUnsigned) {\n        //无符号\n        switch (it.dbType) {\n            case \"tinyint\":\n                max = 255\n                break;\n            case \"smallint\":\n                max = 	65535;\n                break;\n            case \"mediumint\":\n                max = 16777215;\n                break;\n            case \"int\":\n                max = 4294967295;\n                break;\n            case \"bigint\":\n                max = 9007199254740992;  //该值为Js最大值\n                break;\n            default:\n                max = it.length;\n                break;\n        }\n    } else {\n        switch (it.dbType) {\n            case \"tinyint\":\n                max = 127\n                break;\n            case \"smallint\":\n                max = 32767;\n                break;\n            case \"mediumint\":\n                max = 8388607;\n                break;\n            case \"int\":\n                max = 2147483647;\n                break;\n            case \"bigint\":\n                max = 9007199254740992;  //该值为Js最大值\n                break;\n            default:\n                max = it.length;\n                break;\n        }\n    }\n\n    return max;\n}\n\n/**\n * 查找domain命名空间\n *\n * @param dir\n */\ndef findDomainPackageName(dir) {\n    return findPackageName(new File(dir.getParent() + \"/domain\"))\n}\n\n/**\n * 查找service命名空间\n *\n * @param dir\n */\ndef findServicePackageName(dir) {\n    return findPackageName(new File(dir.getParent() + \"/service\"))\n}\n\n/**\n * 查找指定目录现有的命名空间\n *\n * @param dir\n * @return\n */\ndef findPackageName(dir) {\n    if(dir != null && dir.isDirectory()) {\n        File[] files = dir.listFiles();\n        if(files != null && files.length>0) {\n            for (File item:files) {\n                if(item.isFile()) {\n                    List<String> lines = Files.readLines(item, StandardCharsets.UTF_8);\n                    //查找命名空间\n                    for (String line: lines) {\n                        line = line.trim();\n                        if(line.startsWith(\"package\")) {\n                            line = line.split(\" \")[1];\n                            line = line.replace(\";\", \"\")\n                            line = line.trim();\n                            return line;\n                        }\n                    }\n                }\n            }\n        }\n    }\n    return \"\"\n}\n\n/**\n * 首字母小写\n * @param s\n * @return\n */\ndef toLowerCaseFirstOne(String s){\n    if(Character.isLowerCase(s.charAt(0)))\n        return s;\n    else\n        return (new StringBuilder()).append(Character.toLowerCase(s.charAt(0))).append(s.substring(1)).toString();\n}\n\n/**\n * 转换成中划线\n *\n * @param s\n * @return\n */\ndef toStrikethrough(String str) {\n    def s = com.intellij.psi.codeStyle.NameUtil.splitNameIntoWords(str)\n            .collect { Case.LOWER.apply(it) }\n            .join(\"-\")\n            .replaceAll(/[^\\p{javaJavaIdentifierPart}[_]]/, \"_\")\n    return s\n}\n\n/**\n * 获取当前时间\n * @return\n */\ndef currentDate() {\n    Date d = new Date();\n    SimpleDateFormat sdf = new SimpleDateFormat(\"yyyy-MM-dd HH:mm:ss\");\n    String dateNowStr = sdf.format(d);\n    return dateNowStr;\n}\n\n/**\n * 获取注解选项\n *\n * @param comment\n * @return\n */\ndef getOptions(String comment) {\n    if(comment == null) {\n        return []\n    }\n    String[] parts = comment.split(\";\");\n    if(parts.length<2) {\n        return null;\n    }\n//    String colmenName = parts[0];\n    parts = parts[1].split(\",\");\n    HashMap<String, String> dataMap = new HashMap<>();\n    for (String item: parts) {\n        String[] kv = item.split(\":\");\n        if(kv.length == 2) {\n            dataMap.put(kv[0].trim(), kv[1]);\n        } else {\n            dataMap.put(kv[0], kv[0]);\n        }\n    }\n    return dataMap;\n}\n\n/**\n * 获取前端展示类型\n *\"frontType\"\n * @param comment\n */\ndef getExtendData(String comment, String key, String defaultVal) {\n    String type = defaultVal\n    if(comment == \'\' || comment == null) {\n        return defaultVal\n    }\n    String[] parts = comment.split(\";\");\n    if(parts.length<3) {\n        return type;\n    }\n    if(parts.length>=3) {\n        parts = parts[2].split(\",\");\n        HashMap<String, String> dataMap = new HashMap<>();\n        for (String item: parts) {\n            String[] kv = item.split(\":\");\n            if(kv.length == 2) {\n                dataMap.put(kv[0].trim(), kv[1]);\n            }\n        }\n        if(dataMap.containsKey(key)) {\n            type = dataMap.get(key)\n        }\n    }\n    return type\n}\n\n/**\n * 获取表前端首页类型\n *\n * @param table\n * @return\n */\ndef getTableFrontHome(table) {\n    def fontType = getExtendData(table.comment, \'frontHome\', \'list\')\n    return fontType;\n}\n\n/**\n * 获取制定字段类型\n *\n * @param name\n * @param fileds\n */\ndef getCol(name, fileds) {\n    def col = null;\n    fileds.each() {\n        if(name == it.name) {\n            col = it;\n        }\n 