ct != \'\') {\n      def foreign = tool.getExtendData(it.comment, \'foreign\', null)\n\n      code += (\n              \"\\n      ${it.camelCase}: {\")\n      if(!foreign && it.dict == \'\') {\n        def comment = it.comment\n        def options = tool.getOptions(comment)\n        options.each {entry ->\n          code += (\n                  \"\\n           \'${entry.key}\': \'${entry.value}\',\"\n          )\n        }\n      }\n      code += (\"\\n      },\")\n    }\n  }\n  code += (\n          \"\\n    },\\n\" +\n                  \"    optionValueLabel: {\")\n  fields.each() {\n    if(it.frontType == \'select\' || it.frontType == \'checkbox\' || it.dict != \'\') {\n      def foreign = tool.getExtendData(it.comment, \'foreign\', null)\n\n      code += (\n              \"\\n      ${it.camelCase}: [\")\n      if(!foreign && it.dict == \'\') {\n        def comment = it.comment\n        def options = tool.getOptions(comment)\n        options.each {entry ->\n          code += (\n                  \"\\n           {value: ${entry.key}, label:\'${entry.value}\'},\"\n          )\n        }\n      }\n      code += (\"\\n      ],\")\n    }\n  }\n  code += (        \"\\n    },\\n\" +\n          \"    trees: {\\n\")\n  //循环输出tree options\n  fields.each() {\n    if(it.frontType == \'treeSelect\') {\n      if(it.camelCase) {\n        code += (\"           ${it.camelCase}: [],\\n\")\n      }\n    }\n  }\n  code += \"     }\\n\"\n\n  code += \"  },\\n\" +\n          \"\\n\" +\n          \"  subscriptions: {\\n\" +\n          \"    setup({ dispatch, history }) {\\n\" +\n          \"      history.listen(({ pathname }) => {\\n\" +\n          \"        const match = pathToRegexp(\'/${t.name}/:id\').exec(pathname)\\n\" +\n          \"        if (match) {\\n\" +\n          \"          dispatch({ type: \'query\', payload: { id: match[1] } })\\n\"\n\n  fields.each() {\n    if (it.frontType == \'select\' || it.frontType == \'checkbox\' || it.dict != \'\') {\n      def foreign = tool.ge