  \"        })\\n\" +\n          \"      } else {\\n\" +\n          \"        throw data\\n\" +\n          \"      }\\n\" +\n          \"    },\\n\"\n\n  //TODO 循环输出关联表查询\n  fields.each() {\n    //字典请求\n    if(it.dict != \'\') {\n      code += \"    *query${it.upperCamelCase}Options({ payload }, { call, put }) {\\n\" +\n              \"      const data = yield call(query${it.upperCamelCase}Options, payload)\\n\" +\n              \"      if (data.success) {\\n\" +\n              \"        yield put({\\n\" +\n              \"          type: \'queryOptionValueLabel\',\\n\" +\n              \"          payload: {\\n\" +\n              \"              ${it.camelCase}: data.payload\\n\" +\n              \"          },\\n\" +\n              \"        })\\n\" +\n              \"      } else {\\n\" +\n              \"        throw data\\n\" +\n              \"      }\\n\" +\n              \"    },\\n\"\n    }\n\n    if(it.frontType == \'select\' || it.frontType == \'checkbox\') {\n      if(it.foreignTableUpperCamelCaseName) {\n        code += (\n                \"    *query${it.foreignTableUpperCamelCaseName}Options({ payload }, { call, put }) {\\n\" +\n                        \"      const data = yield call(query${it.foreignTableUpperCamelCaseName}Options, payload)\\n\" +\n                        \"      if (data.success) {\\n\" +\n                        \"        yield put({\\n\" +\n                        \"          type: \'queryOptionValueLabel\',\\n\" +\n                        \"          payload: {\\n\" +\n                        \"              ${it.camelCase}: data.payload\\n\" +\n                        \"          },\\n\" +\n                        \"        })\\n\" +\n                        \"      } else {\\n\" +\n                        \"        throw data\\n\" +\n                        \"      }\\n\" +\n                        \"    },\\n\"\n        )\n      }\n\n    } else if(it.frontType == \'treeSelect\') {\n      if(it.foreignTableUpperCamelCaseName) 